pragma solidity 0.8.1;
pragma abicoder v2;

import "./interfaces/IAsset.sol";
import "./interfaces/IAssetSettings.sol";
import "./interfaces/ILpDeployer.sol";
import "./interfaces/IQLP.sol";
import "../Pool/interfaces/IPool.sol";
import "../interfaces/ICallback.sol";

import "../interfaces/IEventOut.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";


//
//LP PVE
contract Asset is IAsset{

    using SafeERC20 for ERC20;
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    mapping(uint32 => Position) public _positions;
    address public _assetAddress;
    address public _settingAddress;
    uint256 public override _liquidityPool = 0;//
    address public _lp;
    uint32 public _positionIndex = 0;
    uint256 public constant StandardDecimal = 18;
    uint256 public override _precisionDiff;

    bool public unlocked = true;

    modifier lock() {
        require(unlocked, 'LOK');
        unlocked = false;
        _;
        unlocked = true;
    }

    constructor(address poolToken,address setting) {
        _assetAddress = poolToken;
        _settingAddress = setting;

        uint256 _poolDecimalDiff = StandardDecimal > ERC20(poolToken).decimals()
        ? StandardDecimal - ERC20(poolToken).decimals()
        : 0;
        if (_poolDecimalDiff > 0) {
            _precisionDiff = 10**_poolDecimalDiff;
        } else {
            _precisionDiff = 1;
        }
        _lp = ILpDeployer(IAssetSettings(_settingAddress).lpDeployer()).deployLP(_assetAddress,_settingAddress);
        // 
        // bytes memory data = abi.encode(_assetAddress,_settingAddress,_lp,address(this)ERC20(poolToken).decimals());
        // eventOut(1,data);
    }
    function userPayAsset(address payer,
        uint256 amount) internal {
        IERC20(_assetAddress).safeTransferFrom(payer,address(this),amount);
    }

    function userPayLp(address payer,
        uint256 amount) internal {
        IERC20(_lp).safeTransferFrom(payer,address(this),amount);

    }

    function tokenCallBack(address user,address tokenAddress, uint256 amount) internal lock {
        uint256 balanceBefore = IERC20(tokenAddress).balanceOf(address(this));
        ICallback(msg.sender).assetCallback(
            amount,
            tokenAddress,
            user
        );
        require(
            IERC20(tokenAddress).balanceOf(address(this)) >=
                balanceBefore.add(amount),
            "poolToken is not enough"
        );
    }

    function getLPAmount(uint256 assetAmount) internal view returns (uint256) {
        if (_liquidityPool == 0) {
            return assetAmount;
        }
        return assetAmount.mul(IERC20(_lp).totalSupply()).div(_liquidityPool);
    }

    function getAssetAmount(uint256 lpAmount) internal view returns (uint256) {
        return lpAmount.mul(_liquidityPool).div(IERC20(_lp).totalSupply());
    }

    function addLiquidity(address receipt,AmountIn calldata amountIn) external override{
        require(amountIn.amount > 0,"invalid amountIn");
        if (amountIn.payType == 1) {
            userPayAsset(msg.sender,amountIn.amount);
        } else {
            tokenCallBack(amountIn.payerAddress,_assetAddress,amountIn.amount);
        }
        uint256 lpAmount = getLPAmount(amountIn.amount);
        _liquidityPool = _liquidityPool.add(amountIn.amount);

        IQLP(_lp).mint(receipt,lpAmount);
        bytes memory data = abi.encode(receipt,amountIn.amount,lpAmount);
        eventOut(2,data);

    }

    function removeLiquidity(address receipt,AmountIn calldata amountIn) external override {
        if (amountIn.payType == 1) {
            userPayLp(msg.sender,amountIn.amount);
        } else {
            tokenCallBack(amountIn.payerAddress,_lp,amountIn.amount);
        }
        uint256 assetAmount =  getAssetAmount(amountIn.amount);
        _liquidityPool = _liquidityPool.sub(amountIn.amount);

        IERC20(_assetAddress).safeTransfer(receipt,assetAmount);  
        IQLP(_lp).burn(address(this),amountIn.amount);
        bytes memory data = abi.encode(receipt,assetAmount,amountIn.amount);
        eventOut(3,data);
    }

    function openPosition(address poolAddress,AmountIn calldata amountIn,bytes calldata openParam) external override returns (uint32){
        require(IAssetSettings(_settingAddress).poolStatus(address(this),poolAddress) == 1,"wrong pool status");
        if (amountIn.payType == 1) {
            userPayAsset(msg.sender,amountIn.amount);
        } else {
            tokenCallBack(amountIn.payerAddress,_assetAddress,amountIn.amount);
        }
        uint32 positionId = IPool(poolAddress).openPosition(openParam,amountIn.amount);
        _positionIndex++;
        _positions[_positionIndex] = Position(
            poolAddress,
            positionId,
            msg.sender
        );

        bytes memory data = abi.encode(msg.sender,poolAddress,positionId,_positionIndex);
        eventOut(4,data);
    }

    function addMargin(uint32 positionId,AmountIn calldata amountIn) external override {
        if (amountIn.payType == 1) {
            userPayAsset(msg.sender,amountIn.amount);
        } else {
            tokenCallBack(amountIn.payerAddress,_assetAddress,amountIn.amount);
        }

        IPool(_positions[positionId].poolAddress).addMargin(_positions[positionId].positionId,amountIn.amount);
    }

    function closePosition(uint32 positionId,address receipt) external override {
        Position memory p = _positions[positionId];
        require(p.poolAddress != address(0),"Error positionId");
        require(p.userAddress == msg.sender,"Error owner");
        require(IAssetSettings(_settingAddress).poolStatus(address(this),p.poolAddress) == 1,"wrong pool status");
        IPool.Position memory pPosition;
        (pPosition.sender,pPosition.openPrice,pPosition.openBlock,pPosition.margin,pPosition.size,pPosition.direction,pPosition.leverage,) = IPool(p.poolAddress)._positions(p.positionId);
        (uint256 transferOut,uint256 fee,) = IPool(p.poolAddress).closePosition(p.positionId);
        pPosition.margin = pPosition.margin.div(_precisionDiff);

        transferOut = transferOut.div(_precisionDiff);
        fee = fee.div(_precisionDiff);//fee
        _liquidityPool = _liquidityPool.add(pPosition.margin);
        if (transferOut > _liquidityPool) {
            transferOut = _liquidityPool;
        }
        _liquidityPool = _liquidityPool.sub(transferOut);

        delete _positions[positionId];
        IERC20(_assetAddress).safeTransfer(receipt,transferOut);

        bytes memory data = abi.encode(receipt,positionId,_liquidityPool,transferOut);
        eventOut(5,data);
    }

    function liquidity(uint32 positionId,address receipt) external override {
        Position memory p = _positions[positionId];
        require(p.poolAddress != address(0),"Error positionId"); 
        require(IAssetSettings(_settingAddress).poolStatus(address(this),p.poolAddress) == 1,"wrong pool status");
        IPool.Position memory pPosition;
        (pPosition.sender,pPosition.openPrice,pPosition.openBlock,pPosition.margin,pPosition.size,pPosition.direction,pPosition.leverage,) = IPool(p.poolAddress)._positions(p.positionId);
        pPosition.margin = pPosition.margin.div(_precisionDiff);
        (uint256 transferOut,uint256 fee,) = IPool(p.poolAddress).liquidate(p.positionId);
        transferOut = transferOut.div(_precisionDiff);
        fee = fee.div(_precisionDiff);

        _liquidityPool = _liquidityPool.add(pPosition.margin).sub(transferOut);  
        delete _positions[positionId];
        IERC20(_assetAddress).safeTransfer(receipt,transferOut);
        bytes memory data = abi.encode(receipt,positionId,_liquidityPool,transferOut);
        eventOut(6,data);
    }

    function eventOut(uint32 _type,bytes memory _value) internal {
        IEventOut(IAssetSettings(_settingAddress).eventOut()).eventOut(_type,_value);
    }

}
